!function(){"use strict";function validation(val){return""==(val=val.trim())||null==val}const validateEmail=email=>email.match(/^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/);$("#signUpForm").submit(event=>{event.preventDefault();var fname=$("#fname").val(),lname=$("#lname").val(),email=$("#email").val(),password=$("#password").val(),confirmPassword=$("#confirmPassword").val();if(validation(fname))alert("First name field is required.");else if(validation(lname))alert("Last name field is required.");else if(validation(email))alert("Email field is required.");else if(validateEmail(email))if(validation(password))alert("Password field is required.");else if(password.length<=5)alert("Password greater then or equal 6 character.");else if(password!==confirmPassword)alert("Confirm password not match.");else{var formdata={fname:fname,lname:lname,email:email,password:password};axios.post(location.href,formdata).then(({data:data})=>{console.log(data),data.status?(alert(data.message),$("#signUpForm")[0].reset()):Object.keys(data.errors).forEach(key=>{alert(data.errors[key])})})}else alert("Please valid email.")}),$("#signInForm").submit(event=>{event.preventDefault();var email=$("#email").val(),password=$("#password").val();if(validation(email))alert("Email field is required.");else if(validateEmail(email))if(validation(password))alert("Password field is required.");else{var formdata={email:email,password:password};axios.post(location.href,formdata).then(({data:data})=>{if(data.status)return location.href="/";Object.keys(data.errors).forEach(key=>{alert(data.errors[key])})})}else alert("Please valid email.")})}();